int cursorX, cursorY;
static int workingSketch[MAX_Y][MAX_X];


void pencil(int color, int size, int shape) {
	paintSketchArea(cursorX, cursorY, shape, size, color);
}

void stylo(int color) {
	workingSketch[cursorY][cursorX] = color; //Pas la peine de tester la position du pixel, c'est déjà fait dans le updateCursor()
}

void get_keyb(int *keyb) {
	keyb[APPUI] = (MemoryRead(KEYS_DECODE) >> 8) & 0x00000001;
	keyb[TOUCHE] = MemoryRead(KEYS_DECODE) & 0x0000000F;
}

void home_screen() {
	for (int i = 0; i < MAX_Y; i++) {
		for (int j = 0; j < MAX_X; j++) {
			printPixel(i, j, chromaticSketch[i][j]);
		}
	}
}

void get_mouse(int *mouse) {
	mouse[X_POS] = MemoryRead(MOUSE_X);
	mouse[Y_POS] = MemoryRead(MOUSE_Y);
	mouse[Z_POS] = MemoryRead(MOUSE_Z);
	mouse[L_CLICK] = MemoryRead(MOUSE_BUTTONS) & 0x00000001;
	mouse[MID_CLICK] = (MemoryRead(MOUSE_BUTTONS) >> 1) & 0x00000001;
	mouse[R_CLICK] = (MemoryRead(MOUSE_BUTTONS) >> 2) & 0x00000001;
}

void eraser(int size) {
	pencil(WHITE, size, SQUARE);
}

void paintSketchArea(int x, int y, int shape, int size, int color) {
	int i = 0;
	int j = 0;
	int t_pos_x = x;
	int t_pos_y = y;

	if (shape == SQUARE) {
		for (i = 0; i < 2 * size; i++) {
			for (j = 0; j < 2 * size; j++) {
				t_pos_y = (y - size) + i;
				t_pos_x = (x - size) + j;
				if (pix_on_screen(t_pos_x, t_pos_y)) {
					workingSketch[t_pos_y][t_pos_x] = color;
				}
			}
		}
	}
}

void paint_background(int color) {
	for (int i = 0; i < MAX_Y; i++) {
		for (int j = 0; j < MAX_X; j++) {
			printPixel(i, j, color);
		}
	}
}

int pix_on_screen(int x, int y) {
	return (isXonScreen(x) && isYonScreen(y));
}

int isXonScreen(int x){
	return (!((x < 0) || (x > (MAX_X -1)) ));
}
int isYonScreen(int y){
	return (!((y < 0) || (y > (MAX_Y -1)) ));
}


void clearSketch(int color) {
	for (int i = 0; i < MAX_Y; i++) {
		for (int j = 0; j < MAX_X; j++) {
			workingSketch[i][j] = color;
		}
	}
}

void init_oled_bitmap() {
	MemoryWrite(OLED_MUX, OLED_MUX_BITMAP);
	MemoryWrite(OLED_BITMAP_RST, 1); // Reset the oled_rgb PMOD
}

//Function used to color a pixel at a given position (row, col)
void printPixel(char row, char col, int color) {
	int buff = 0x00000000;

	buff = color;
	buff = (buff << 8) | row;
	buff = (buff << 8) | col;

	MemoryWrite(OLED_BITMAP_RW, buff);
}

void initSketch() {
	for (int i = 0; i < MAX_Y; i++) {
		for (int j = 0; j < MAX_X; j++) {
			workingSketch[i][j] = WHITE;
		}
	}
}

// Pour éviter les clignotements du curseur, on l'affiche en brut directement dans cette fonction
void displaySketch() {
	for (int i = 0; i < MAX_Y; i++) {
		for (int j = 0; j < MAX_X; j++) {
			if((j!=cursorX) && (i!=cursorY))
				printPixel(i, j, workingSketch[i][j]);
			else
				printPixel(i, j, BLACK);
		}
	}
}

